syms s l v psi e delta k T

% State variables
x = [e;  % Crosstrack error %[output:group:4aeb34a5] %[output:9f6d738c]
    psi] % Heading error %[output:group:4aeb34a5] %[output:9f6d738c]

% Input variables
u = [delta] % Steering angle %[output:1ae5aadc]

% Path-relative nonlinear dynamics
f = [v*sin(psi - delta);  %[output:group:076e3e84] %[output:3eff10ee]
    -v/l * sin(delta)] %[output:group:076e3e84] %[output:3eff10ee]

% Equilibrium states and inputs
x0 = [0; 0] %[output:30ad06ae]
u0 = [0] %[output:437fc326]

% Linearized dynamics matrices
A = subs(jacobian(f, x), [x; u], [x0; u0]) %[output:2114da94]
B = subs(jacobian(f, u), [x; u], [x0; u0]) %[output:2cea8a39]

C_psi = [0 1] %[output:9b31ae70]
C_e = [1 0] %[output:442b33da]

% Convert to open loop transfer functions from steering to e and psi
TF_ol = simplify(inv(s * eye(2,2) - A) * B) %[output:00426254]

% Nonlinear stanley controller
stanley = psi + atan(k*e/v) %[output:37b4efbb]

% Linearized stanley controller
K = subs(jacobian(stanley, x), x, x0) %[output:1edaa4d4]

% Forward path transfer function matrix
G = TF_ol * K %[output:0c62dd00]

% Closed loop transfer function matrix 
% all real poles, as expected, no oscillations
TF_cl = simplify(inv(eye(2,2) - G) * G) %[output:73e64cac]

% Bilinear transform to approximate time delay as s-domain polynomial
delay = simplify((1 + s*T/2) / (1 - s*T/2)) %[output:5dad1bfc]

TF_cl = simplify(inv(eye(2,2) - G / delay) * G ) %[output:8c33024c]

[num, den] = numden(TF_cl(1,1)) %[output:4491dd68] %[output:8987ccea]

dTs = 0:0.005:1.0;
fs = zeros(1,length(dTs));
for i = 1:numel(fs)
    dT = dTs(i);
    den_val = subs(den, [v l k T], [10.0 1.2 1.3 dT]);
    den_fp = sym2poly(den_val);
    poles = roots(den_fp);
    osc_f = max(imag(poles)) / 2 / pi;
    fs(i) = osc_f;
end

set(gca,'XMinorTick','on','YMinorTick','on') %[output:4b60174c]
plot(dTs * 1000, fs) %[output:4b60174c]
xlabel("Time Delay (ms)") %[output:4b60174c]
xticks(0:100:1000) %[output:4b60174c]
ylabel("Oscillation Frequency (Hz)") %[output:4b60174c]
grid on %[output:4b60174c]
grid minor %[output:4b60174c]

